import Login from './Login';

import { Router, Route} from 'react-router';

import { Root } from './Root';
import { Home } from './Home';
import { User } from './User';

function App() {
  return (
    <div className="App">
        <h1> Test React </h1>
        <Router>
        <Route path={"user"} component={User}/>
        <Route path={"home"} component={Home}/>
        </Router>

        < Login />

    </div>
  );
}

export default App;
